.text

.globl _start

_start:


#-----------------------------------------------------------
#               Convolution Layer
#-----------------------------------------------------------

    li s0, 28    # image size
    li s1, 784   # image length
    li s2, 5    # filter size
    li s3, 25    # filter length
    li s4, 24    # output size
    li s5, 576   # output length

    la a0, Input                    # Load base address of INPUT

    la a1, Filter_1_Weights         # Load base address of FILTER
    la a2, Bias_1                   # Load base address of BIAS
    la a3, Output_1                 # Load base address of OUTPUT
    flw f0, 0(a2)                   # Load bias into f0

    jal ra, convolution

    la a1, Filter_2_Weights         # Load base address of FILTER
    la a2, Bias_2                   # Load base address of BIAS
    la a3, Output_2                 # Load base address of OUTPUT
    flw f0, 0(a2)                   # Load bias into f0

    jal ra, convolution

    la a1, Filter_3_Weights         # Load base address of FILTER
    la a2, Bias_3                   # Load base address of BIAS
    la a3, Output_3                 # Load base address of OUTPUT
    flw f0, 0(a2)                   # Load bias into f0

    jal ra, convolution

    la a1, Filter_4_Weights         # Load base address of FILTER
    la a2, Bias_4                   # Load base address of BIAS
    la a3, Output_4                 # Load base address of OUTPUT
    flw f0, 0(a2)                   # Load bias into f0

    jal ra, convolution

    la a1, Filter_5_Weights         # Load base address of FILTER
    la a2, Bias_5                   # Load base address of BIAS
    la a3, Output_5                 # Load base address of OUTPUT
    flw f0, 0(a2)                   # Load bias into f0

    jal ra, convolution

    la a1, Filter_6_Weights         # Load base address of FILTER
    la a2, Bias_6                   # Load base address of BIAS
    la a3, Output_6                 # Load base address of OUTPUT
    flw f0, 0(a2)                   # Load bias into f0

    jal ra, convolution

    la a1, Filter_7_Weights         # Load base address of FILTER
    la a2, Bias_7                   # Load base address of BIAS
    la a3, Output_7                 # Load base address of OUTPUT
    flw f0, 0(a2)                   # Load bias into f0

    jal ra, convolution

    la a1, Filter_8_Weights         # Load base address of FILTER
    la a2, Bias_8                   # Load base address of BIAS
    la a3, Output_8                 # Load base address of OUTPUT
    flw f0, 0(a2)                   # Load bias into f0

    jal ra, convolution

    j end_convolution

convolution:
    li t0, 0    # i = 0
loop_A:
    beq t0, s4, end_loop_A  # while less than out_sz

    li t1, 0 # j = 0
loop_B:
    beq t1, s4, end_loop_B # while less than out_sz
    fcvt.s.w f1, zero # sum = 0

    li t2, 0 # m = 0
loop_C:
    beq t2, s2, end_loop_C # while less than fil_sz

    li t3, 0 # n = 0
loop_D:
    beq t3, s2, end_loop_D

    add t4, t0, t2  # im_row = i + m
    add t5, t1, t3  # im_col = j + n

    mul t4, t4, s0  # im_index = im_row * IM_SIZE + im_col
    add t4, t4, t5

    mul t5, t2, s2  # filter index
    add t5, t5, t3

    slli t4, t4, 2  # get image address
    add t4, t4, a0

    slli t5, t5, 2  # get filter address
    add t5, t5, a1

    flw f2, 0(t4) # image value
    flw f3, 0(t5) # filter value

    fmul.s f4, f2, f3
    fadd.s f1, f1, f4

    addi t3, t3, 1
    j loop_D
end_loop_D:
    addi t2, t2, 1
    j loop_C
end_loop_C:

    fadd.s f1, f1, f0   # add bias to sum

    mul t2, t0, s4  # compute output index
    add t2, t2, t1

    slli t2, t2, 2  # get output address
    add t2, a3, t2

    fsw f1, 0(t2)   # store there

    addi t1, t1, 1
    j loop_B
end_loop_B:

    addi t0, t0, 1
    j loop_A
end_loop_A:
    jr ra

end_convolution:

#------------------------------------------------------------
#                   ReLU Activation
#------------------------------------------------------------

    
    li t0, 576  # n - number of element in the matrix
    li t1, 0    # i = 0
    fcvt.s.w f0, zero # floating zero that will be used in comparison


    la a0, Output_1 # address of start of input matrix
    li t1, 0    # i = 0
    jal ra, relu_loop

    la a0, Output_2 # address of start of input matrix
    li t1, 0    # i = 0
    jal ra, relu_loop

    la a0, Output_3 # address of start of input matrix
    li t1, 0    # i = 0
    jal ra, relu_loop

    la a0, Output_4 # address of start of input matrix
    li t1, 0    # i = 0
    jal ra, relu_loop

    la a0, Output_5 # address of start of input matrix
    li t1, 0    # i = 0
    jal ra, relu_loop

    la a0, Output_6 # address of start of input matrix
    li t1, 0    # i = 0
    jal ra, relu_loop

    la a0, Output_7 # address of start of input matrix
    li t1, 0    # i = 0
    jal ra, relu_loop

    la a0, Output_8 # address of start of input matrix
    li t1, 0    # i = 0
    jal ra, relu_loop
    
    j end_relu
    
relu_loop:
    beq t1, t0, end_relu_loop     # if i == n, break

    slli t2, t1, 2      # t2 = i * 4 (offset of 4 bytes)
    add t3, a0, t2      # t3 holds the address of the current element
   
    flw f1, 0(t3)        # t3 = INPUT[i]

    fmax.s f2, f1, f0 # f2 = max(f1, 0)
    
    fsw f2, 0(t3)
    addi t1, t1, 1
    j relu_loop


end_relu_loop:

    jr ra

end_relu:

#------------------------------------------------------------
#                   MaxPool
#------------------------------------------------------------

    li s0, 576 # elements in input matrix
    li s1, 144 # elements in output matrix
    li s2, 24 # input dim
    li s3, 12 # output dim

    la a0, Output_1
    la a1, MaxPool_Output_1
    li t0, 0 # k = 0
    jal ra, maxpool_loop
    

    la a0, Output_2
    la a1, MaxPool_Output_2
    li t0, 0 # k = 0
    jal ra, maxpool_loop


    la a0, Output_3
    la a1, MaxPool_Output_3
    li t0, 0 # k = 0
    jal ra, maxpool_loop


    la a0, Output_4
    la a1, MaxPool_Output_4
    li t0, 0 # k = 0
    jal ra, maxpool_loop


    la a0, Output_5
    la a1, MaxPool_Output_5
    li t0, 0 # k = 0
    jal ra, maxpool_loop


    la a0, Output_6
    la a1, MaxPool_Output_6
    li t0, 0 # k = 0
    jal ra, maxpool_loop


    la a0, Output_7
    la a1, MaxPool_Output_7
    li t0, 0 # k = 0
    jal ra, maxpool_loop


    la a0, Output_8
    la a1, MaxPool_Output_8
    li t0, 0 # k = 0
    jal ra, maxpool_loop

    
  
    j maxpoop_end    
 
maxpool_loop:
    beq t0, s1, maxpoop_loop_end
    
    # mapping 1D array to 2D
    div t1, t0, s3 # t1 = i
    rem t2, t0, s3 # t2 = j
    
    add t3, t1, t1 # temp1 = 2 * i
    addi t4, t3, 1 # temp2 = 2 * i + 1
    add t5, t2, t2 # temp3 = 2 * j
    addi t6, t5, 1 # temp4 = 2 * j + 1
    
    mul s4, t3, s2 # temp1 * input_dim
    add t1, s4, t5 # top left 
    add t2, s4, t6 # top right
    
    mul s4, t4, s2 # temp2* input_dim
    add t3, s4, t5 # bottom left
    add t4, s4, t6 # bottom right
    
    slli t1, t1, 2 # compute amount to offset
    slli t2, t2, 2
    slli t3, t3, 2
    slli t4, t4, 2
    
    add t1, a0, t1 # add offset
    add t2, a0, t2
    add t3, a0, t3
    add t4, a0, t4
    
    flw f0, 0(t1) # load values
    flw f1, 0(t2)
    flw f2, 0(t3)
    flw f3, 0(t4)
    
    fmax.s f0, f0, f1 # get max
    fmax.s f0, f0, f2
    fmax.s f0, f0, f3
    
    slli t0, t0, 2 # i = i * 4 | we will divide by 4 for proper incrementing | done to save registers
    
    add t1, a1, t0
    
    fsw f0, 0(t1)
    
    srli t0, t0, 2 # i = i / 4
    
    addi t0, t0, 1
    
    j maxpool_loop

maxpoop_loop_end:
    jr ra
maxpoop_end:


#------------------------------------------------------------
#                   Flatten
#------------------------------------------------------------

    la a0, MaxPool_Output_1
    la a1, Flatten_Data
    
    li t0, 0 # i = 0
    li t1, 8 # 8 matrices
    li t2, 144 # enries in each matrix
    
flatten_loop:
    beq t0, t2, end_flatten_loop        # col
    
    li t3, 0
inner_flatten_loop:
    beq t3, t1, end_inner_flatten_loop  # row
    
    mul s0, t3, t2
    add s0, s0, t0
    
    slli s0, s0, 2
    add s0, s0, a0
    
    flw f0, 0(s0)
    
    fsw f0, 0(a1)
    
    addi a1, a1, 4
    
    
    addi t3, t3, 1
    j inner_flatten_loop
    
end_inner_flatten_loop:    
    
    addi t0, t0, 1
    j flatten_loop
end_flatten_loop:

